INSERT INTO `objetivos_estrategicos` VALUES (1,'Fortalecer a trav√©s de los procesos electorales la Revoluci√≥n Bolivariana, elevando la moral y la conciencia del pueblo venezolano y de los pueblos del mundo en su lucha por la emancipaci√≥n.',1),(2,'Preparar la defensa de la voluntad del pueblo, mediante la organizaci√≥n popular y el ejercicio democr√°tico de la autoridad del Estado',1),(3,'Fortalecer y expandir el Poder Popular.',1),(4,'Preservar y recuperar los espacios de gobierno regional y local, para profundizar la restituci√≥n del poder al pueblo.',1),(5,'Seguir construyendo la soberan√≠a y democratizaci√≥n comunicacional.',1),(6,'Fortalecer el rol del Estado en la administraci√≥n y explotaci√≥n de los recursos hidrocarbur√≠feros y mineros.',2),(7,'Mantener y garantizar el control por parte del Estado sobre Petr√≥leos de Venezuela S.A. (Pdvsa).',2),(8,'Mantener y garantizar el control por parte del Estado de las empresas nacionales que exploten los recursos mineros en el territorio nacional.',2),(9,'Promover y estimular la investigaci√≥n cient√≠fica y el desarrollo tecnol√≥gico, con el prop√≥sito de asegurar las operaciones medulares de la industria petrolera.',2),(10,'Asegurar los medios para el control efectivo de las actividades conexas y estrat√©gicas asociadas a la cadena industrial de explotaci√≥n de los recursos hidrocarbur√≠feros.',2),(11,'Fortalecer la coordinaci√≥n de pol√≠ticas petroleras en el seno de la OPEP y otros organismos interTasa nacionales, para la justa valorizaci√≥n de nuestros recursos naturales.',2),(12,'Impulsar y promover una iniciativa de coordinaci√≥n entre los pa√≠ses gigantes petroleros.',2),(13,'Asegurar los medios para el control efectivo de las actividades conexas y estrat√©gicas asociadas a la cadena industrial de explotaci√≥n de los recursos mineros.',2),(14,'Lograr una instancia de coordinaci√≥n de pol√≠ticas gas√≠feras para una valorizaci√≥n justa y razonable del gas.',2),(15,'Elevar la conciencia pol√≠tica e ideol√≥gica del Pueblo y de los trabajadores petroleros y mineros, as√≠ como tambi√©n su participaci√≥n activa en la defensa de los recursos naturales estrat√©gicos de la Naci√≥n.',2),(16,'Crear las condiciones para influir en la valorizaci√≥n de los precios de los minerales.',2),(17,'Garantizar la propiedad y uso de los recursos naturales del pa√≠s, de forma soberana, para la satisfacci√≥n de las demandas internas as√≠ como su uso en funci√≥n de los m√°s altos intereses nacionales.',2),(18,'Mantener y fortalecer el actual r√©gimen fiscal petrolero para garantizar el bienestar del pueblo.',3),(19,'Mantener y fortalecer mecanismos eficaces de captaci√≥n de la renta excedentaria, por incrementos extraordinarios de los precios internacionales de los hidrocarburos.',3),(20,'Establecer y desarrollar un r√©gimen fiscal minero, as√≠ como mecanismos de captaci√≥n eficientes para la recaudaci√≥n de la renta por la actividad minera.',3),(21,'Establecer mecanismos de control sobre la comercializaci√≥n de los minerales.',3),(22,'Fortalecer y profundizar acuerdos financieros con socios estrat√©gicos.',3),(23,'Mantener y consolidar los convenios de cooperaci√≥n, solidaridad y complementariedad con pa√≠ses aliados.',3),(24,'Fortalecer los mecanismos de cooperaci√≥n en el Mercado Com√∫n del Sur (Mercosur).',3),(25,'Dise√±ar y establecer mecanismos novedosos y efectivos, orientados a promover la participaci√≥n popular en la renta petrolera, tales como la inversi√≥n y el ahorro.',3),(26,'Compatibilizar el sistema impositivo hacia est√°ndares internacionales de eficiencia tributaria para alcanzar acuerdos comerciales m√°s efectivos y eficientes con los pa√≠ses socios, salvaguardando la soberan√≠a nacional.',3),(27,'Mejorar y promover la eficiencia de la gesti√≥n fiscal del sector p√∫blico para generar mayor transparencia y confiabilidad sobre el impacto econ√≥mico y social de la pol√≠tica fiscal.',3),(28,'Eliminar definitivamente el latifundio. Realizar un proceso de organizaci√≥n y zonificaci√≥n