INSERT INTO `objetivos_nacionales` VALUES (1,'Garantizar la continuidad y consolidaci√≥n de la Revoluci√≥n Bolivariana.',1),(2,'Preservar y consolidar la soberan√≠a sobre los recursos petroleros y dem√°s recursos naturales estrat√©gicos.',1),(3,'Garantizar el manejo soberano del ingreso nacional.',1),(4,'Lograr la soberan√≠a alimentaria para garantizar el sagrado derecho a la alimentaci√≥n de nuestro pueblo.',1),(5,'Desarrollar nuestras capacidades cient√≠fico-tecnol√≥gicas vinculadas a las necesidades del pueblo.',1),(6,'Fortalecer el poder defensivo nacional para proteger la Independencia y la soberan√≠a nacional, asegurando los recursos y riquezas de nuestro pa√≠s para las futuras generaciones.',1),(7,'Adecuar el aparato econ√≥mico productivo, la infraestructura y los servicios del Estado incrementando la capacidad de respuesta a las necesidades del pueblo ante posibles estados de excepci√≥n en el marco de la Defensa Integral de la Naci√≥n.',1),(8,'Propulsar la transformaci√≥n del sistema econ√≥mico, en funci√≥n de la transici√≥n al socialismo bolivariano, trascendiendo el modelo rentista petrolero capitalista hacia el modelo econ√≥mico productivo socialista, basado en el desarrollo de las fuerzas productivas.',2),(9,'Construir una sociedad igualitaria y justa.',2),(10,'Consolidar y expandir el poder popular y la democracia socialista.',2),(11,'Convocar y promover una nueva orientaci√≥n √©tica, moral y espiritual de la sociedad, basada en los valores liberadores del socialismo.',2),(12,'Lograr la irrupci√≥n definitiva del Nuevo Estado Democr√°tico y Social, de Derecho y de Justicia.',2),(13,'Consolidar el papel de Venezuela como Potencia Energ√©tica Mundial.',3),(14,'Desarrollar el poder√≠o econ√≥mico en base al aprovechamiento √≥ptimo de las potencialidades que ofrecen nuestros recursos para la generaci√≥n de la m√°xima felicidad de nuestro pueblo, as√≠ como de las bases materiales para la construcci√≥n de nuestro socialismo bolivariano.',3),(15,'Ampliar y conformar el poder√≠o militar para la defensa de la Patria. Nuestra Patria promueve la cooperaci√≥n pac√≠fica entre las naciones, impulsa la integraci√≥n latinoamericana y caribe√±a, el principio de autodeterminaci√≥n de los pueblos y la no intervenci√≥n en los asuntos internos de cada pa√≠s, es por ello que el poder√≠o militar del pa√≠s es netamente defensivo y disuasivo, que no amenaza a nadie ni tiene pretensiones invasoras, todo lo contrario somos promotores de la paz y de la integraci√≥n latinoamericana y caribe√±a para contribuir con la defensa de nuestros pueblos, ello nos obliga a garantizar cada d√≠a el fortalecimiento de nuestras propias doctrinas y tecnolog√≠as militares que nos permitan ser una referencia pac√≠fica en la regi√≥n, adecuando nuestra industria militar a nuestras propias necesidades, derivadas de la realidad geoestrat√©gica de nuestra Patria, vali√©ndonos de la cooperaci√≥n con pa√≠ses amigos.',3),(16,'Profundizar el desarrollo de la nueva geopol√≠tica nacional.',3),(17,'Continuar desempe√±ando un papel protag√≥nico en la construcci√≥n de la uni√≥n latinoamericana y caribe√±a.',4),(18,'Afianzar la identidad nacional y nuestroamericana.',4),(19,'Continuar impulsando el desarrollo de un mundo multic√©ntrico y pluripolar sin dominaci√≥n imperial y con respeto a la autodeterminaci√≥n de los pueblos.',4),(20,'Desmontar el sistema neocolonial de dominaci√≥n imperial.',4),(21,'Construir e impulsar el modelo econ√≥mico produc¬≠tivo eco-socialista, basado en una relaci√≥n arm√≥nica entre el hombre y la naturaleza, que garantice el uso y aprovechamiento racional, √≥ptimo y sostenible de los recursos naturales, respetando los procesos y ciclos de la naturaleza.',5),(22,'Proteger y defender la soberan√≠a permanente del Estado sobre los recursos naturales para el beneficio su¬≠premo de nuestro Pueblo, que ser√° su principal garante.',5),(23,'Defender y proteger el patrimonio hist√≥rico y cultu¬≠ral venezolano y nuestroamericano.',5),(24,'Contribuir a la conformaci√≥n de un gran movimiento mundial para contener las causas y reparar los efectos de cambio clim√°tico que ocurren como consecuencia del modelo capitalista depredador.',5);
